import React, {useState} from "react";
import API from "../src/utils/API/apiRoutes"


function Home() {
    const [rate, setRate] =useState()

    function getRate(){
        API.getRate()
        .then(res =>{
            console.log(res)
        })
    }

    return (
        <>
            <button onClick={getRate}>Click here for rate</button>
        </>
    )
}

export default Home
